void sort_accending(int array[], int size){
    int a;
    for(int i=0; i<size; i++){
        for(int j=i+1; j<size; j++){
            if(array[j]<array[i]){
                //swap numbers
                a = array[j];
                array[j] = array[i];
                array[i] = a;
            }
        }
    }
}
