#include <EEPROM.h>


template<typename Type>
struct IProperty {
  virtual ~IProperty() noexcept = default;
  virtual void setValue(const Type&) = 0;
  virtual const Type& value() const = 0;
};

template<typename Type>
class AbstractEepromProperty: public IProperty<Type> {
protected:
  EEPROMClass& m_eeprom;
  const int m_address{};
  Type m_value{};
public:
  AbstractEepromProperty(EEPROMClass& eeprom, int address)
    :m_eeprom{ eeprom }, m_address{ address } {}
public:
  virtual void read_from_eeprom() = 0;
  virtual void write_to_eeprom() = 0;
public:
  virtual const Type& value() const override final {
    return m_value;
  }
};

template<size_t length>
class ByteArrayEepromProperty: public AbstractEepromProperty<uint8_t[length]> {
public:
  ByteArrayEepromProperty(EEPROMClass& eeprom, int address)
    :AbstractEepromProperty<uint8_t[length]>{ eeprom, address } {}
public:
  virtual void setValue(const uint8_t(&value)[length]) override {
    memcpy(this->m_value, value, length);
  }
  virtual void read_from_eeprom() override final {
    this->m_eeprom.readBytes(this->m_address, this->m_value, length);
  }
  virtual void write_to_eeprom() override final {
    this->m_eeprom.writeBytes(this->m_address, this->m_value, length);
  }
};

import java.util.Scanner;

class Trip {
    //declare class and instance constants according to the Java Code Conventions
    private static final int DAILY_RATE = 50;
    private final int numberOfDays;
    private final int fare;

    //declare a parameterized constructor
    public Trip(int numberOfDays, int fare) {
        this.numberOfDays = numberOfDays;
        this.fare = fare;
    }

    public final int totalCost() {
        //write the correct expression instead of 0
        return getDailyRate() * numberOfDays + fare;
    }

    //add protected method and use it the totalCost()
    protected int getDailyRate() {
        return DAILY_RATE;
    }
}

class HomeTrip extends Trip {
    //declare class constant
    private static final int DAILY_RATE = 60;

    //declare a parameterized constructor
    public HomeTrip(int numberOfDays) {
        super(numberOfDays, 0);
    }

    //override the protected method
    @Override
    protected int getDailyRate() {
        return DAILY_RATE;
    }
}

class OneDayTrip extends Trip {
    //declare class constant
    private static final int DAILY_RATE = 35;
    //declare a parameterized constructor

    public OneDayTrip(int fare) {
        super(1, fare);
    }

    //override the protected method
    @Override
    protected int getDailyRate() {
        return DAILY_RATE;
    }
}

class Solution {

    public static Trip getTrip(Scanner sc) {
        int id = sc.nextInt();

        int numberOfDays;
        int fare;

        switch (id) {
            case 1:
                numberOfDays = sc.nextInt();
                return new HomeTrip(numberOfDays);
            case 2:
                fare = sc.nextInt();
                return new OneDayTrip(fare);
            default:
                numberOfDays = sc.nextInt();
                fare = sc.nextInt();
                return new Trip(numberOfDays, fare);
        }
    }
}

