void work_dynamic_array() {

	int n = 50;
	double* x = new double[n]{};
	double* y = new double[n]{};

	double x_min = -10;
	double x_max = 10;
	double step = (x_max - x_min) / (n - 1);
	
	for (int k = 0; k < n; k++) {
		x[k] = x_min + k * step;
		// ÑÐ¸Ð³Ð¼Ð¾Ð¹Ð´Ð°
		y[k] = 1 / (1 + exp(-x[k]));
	}

	for (int k = 0; k < n; k++) {
		cout << x[k] << ": " << y[k] << endl;
	}
	cout << endl;
	delete[] x;
	delete[] y;	
}

int* drop_negatives(int size, int* parr, int& out_size) {
	int n = 0;
	for (int k = 0; k < size; k++) {
		if (parr[k] >= 0) {
			n++;
		}
	}

	int* buff = new int[n];

	for (int k = 0, n = 0; k < 10; k++) {
		if (parr[k] >= 0) {
			buff[n] = parr[k];
			n++;
		}
	}
	out_size = n;
	return buff;
}

