			parr2d[k][n] = n*n + 2*n*k + k*k;

	// Ð²Ñ‹Ð²Ð¾Ð´Ð¸Ð¼ Ð½Ð° ÑÐºÑ€Ð°Ð½
	for (int k = 0; k < 4; k++) {
		for (int n = 0; n < 4; n++)
			cout << parr2d[k][n] << "\t";
		cout << endl;
	}

	// Ð¾Ñ‡Ð¸ÑÑ‚ÐºÐ° Ð¿Ð°Ð¼ÑÑ‚Ð¸
	for (int k = 0; k < 4; k++)
		delete[] parr2d[k];
	// ÑƒÑÑ‚Ð°Ñ€. free()
	delete[] parr2d;
}

void append(int& size, int* &parr, int val) {
	int* buff = new int[size + 1];
	for (int k = 0; k < size; k++)
		buff[k] = parr[k];
	buff[size] = val;
	delete[] parr;
	parr = buff;
	size++;
}

void show(int size, int* arr) {
	for (int k = 0; k < size; k++)
		cout << arr[k] << ", ";
	cout << endl;
}

void task7_work_add_remove() {
	int* parr = new int[0]{};
	int size = 0;
	for (int k = 0; k < 10; k++) {
		append(size, parr, k);
		show(size, parr);
	}
}



